package algo;

import java.time.DayOfWeek;
import java.time.LocalDateTime;
import java.util.Scanner;

public class LcCoOverlaps {
  public static void main(String[] args) throws Exception
  {
    try (Scanner scanner = new Scanner(System.in)) {
      String pat = "";
      final int patCount=707;
      final int cycle = 2800;
      int T = scanner.nextInt();
      for (int tc = 0; tc < T; tc++) {
        int count=0;
        int m1 = scanner.nextInt();
        int y1 = scanner.nextInt();
        if(m1>2)y1++;
        int divisor1=y1/cycle;
        y1%=cycle;

        int m2 = scanner.nextInt();
        int y2 = scanner.nextInt();
        if(m2<2)y2--;
        int divisor2=y2/cycle;
        y2%=cycle;
        if(divisor2-divisor1>1){
          count+=patCount*(divisor2-divisor1-1);
        }
        if(divisor1==divisor2){
          for (int i = y1; i <= y2; i++) {
            if(pat.charAt(i)=='1'){
              count++;
            }
          }
        }else{

          for (int i = y1; i < pat.length(); i++) {
            if(pat.charAt(i)=='1'){
              count++;
            }
          }
          for (int i = 1; i <= y2; i++) {
            if(pat.charAt(i)=='1'){
              count++;
            }
          }
        }
        /*for (int i = y1; i <= y2; i++) {
          LocalDateTime instant = LocalDateTime.of(i,2,1,0,0,0);
          //System.out.print(instant.get(Calendar.DAY_OF_WEEK));
          //if non-leap then feb start sat or sun else sat
          if(i%4==0&&i%100!=0 || i%400==0){
            if(instant.getDayOfWeek()==DayOfWeek.SATURDAY){
              count++;
              //System.out.println(instant.getYear());
            }
          }else{
            if(instant.getDayOfWeek()==DayOfWeek.SATURDAY || instant.getDayOfWeek()==DayOfWeek.SUNDAY){
              //System.out.println(instant.getYear());
              count++;
            }
          }
        }*/
        System.out.println(count);
      }
    }
  }
}
